import React from 'react';
import { InputField } from './components/InputField/InputField';
import { DataTable } from './components/DataTable/DataTable';

function App() {
  const data = [
    { id: 1, name: 'John Doe', age: 25 },
    { id: 2, name: 'Jane Smith', age: 30 }
  ];

  const columns = [
    { key: '1', title: 'ID', dataIndex: 'id' },
    { key: '2', title: 'Name', dataIndex: 'name' },
    { key: '3', title: 'Age', dataIndex: 'age' }
  ];

  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">UI Components Demo</h1>
      <InputField label="Username" placeholder="Enter username" helperText="This is a helper text" />
      <div className="mt-6">
        <DataTable data={data} columns={columns} selectable />
      </div>
    </div>
  );
}

export default App;
